Don't go gently into that good night; 
Rage.

Rage against the dying of the light. 💀

@Jim_Jordan That isn't his tone or attitude and you know it.
When will our representatives start acting like mature human beings again and less like AM rage radio hosts who have to create an atmosphere of us and them, of perpetual victimhood.
Fauci cares about people, unlike Trump and you.
